function sendPacketString(string, size){
    var packet= [];
    var data = string.split(' ');
    
    for(let i = 0; i < data.length; i++){
        packet[i] = parseInt(data[i],16)//.toString(16)
    }

    device.send_report(packet, size);
}

var n = 0;

function Sendchannel(channel, shutdown = false)
{
    var propertyArray = [device1,device2,device3,device4,device5];
    var TotalLedCount = 0;
    var RGBdata = [];


        var deviceNumber = channel;
 
            if(deviceValues[deviceNumber] != "None" && DeviceDict[propertyArray[deviceNumber]] != null){

               for(var iIdx = 0; iIdx < DeviceDict[propertyArray[deviceNumber]].mapping.length; iIdx++){
                   var iPxX = DeviceDict[propertyArray[deviceNumber]].positioning[iIdx][0];
                   var iPxY = DeviceDict[propertyArray[deviceNumber]].positioning[iIdx][1];
                   var mxPxColor;
                   //find colors
                   if(shutdown){
                       mxPxColor = hexToRgb(shutdownColor)
                  }else if (LightingMode == "Forced") {
                       mxPxColor = hexToRgb(forcedColor)
                   }else{
                       mxPxColor = device.subdeviceColor(deviceArray[deviceNumber],iPxX, iPxY);
                   }
                    //set colors
                    RGBdata[DeviceDict[propertyArray[deviceNumber]].mapping[iIdx]*3+TotalLedCount*3] = mxPxColor[1];
                    RGBdata[DeviceDict[propertyArray[deviceNumber]].mapping[iIdx]*3+TotalLedCount*3+1] = mxPxColor[0];
                    RGBdata[DeviceDict[propertyArray[deviceNumber]].mapping[iIdx]*3+TotalLedCount*3+2] = mxPxColor[2];
                   }
                   TotalLedCount += DeviceDict[propertyArray[deviceNumber]].ledCount;
				   // sendDirectPacket(TotalLedCount,channel, RGBdata)
                   if(n <=1){
					   sendDirectPacket(TotalLedCount,channel, RGBdata);
					   n = n + 1;
				   }else{
					   sendDirectPacket2(TotalLedCount,channel, RGBdata);
					   n = n -1;
				   }
				   
                }
}

function SetFans(){
    var propertyArray = [device1,device2,device3,device4,device5];

        for (var deviceNumber = 0; deviceNumber < propertyArray.length; deviceNumber++ ) {
              if(deviceValues[deviceNumber] != propertyArray[deviceNumber]){
                deviceValues[deviceNumber] = propertyArray[deviceNumber];

                 if(deviceValues[deviceNumber] == "None"){
                    device.removeSubdevice(deviceArray[deviceNumber]);
                 }else{
                     //"Ch1 | Port 1"
                    device.createSubdevice(deviceArray[deviceNumber]);
                    // Parent Device + Sub device Name + Ports
                    device.setSubdeviceName(deviceArray[deviceNumber],`${ParentDeviceName} - ${DeviceDict[propertyArray[deviceNumber]].displayName} - ${deviceArray[deviceNumber]}`);
                    device.setSubdeviceImage(deviceArray[deviceNumber], DeviceDict[propertyArray[deviceNumber]].image);
                    device.setSubdeviceSize(deviceArray[deviceNumber],DeviceDict[propertyArray[deviceNumber]].width,DeviceDict[propertyArray[deviceNumber]].height);
                    device.setSubdeviceLeds(deviceArray[deviceNumber],
                        DeviceDict[propertyArray[deviceNumber]].LedNames,
                        DeviceDict[propertyArray[deviceNumber]].positioning)
                 }
            }
        }
}


function sendDirectPacket(LEDcount, channel, data){

	var packet = [];
    packet[0x00] = 0x00;
    packet[0x01] = 0x32;
    packet[0x02] = 0x52;
    packet[0x03] = channel + 1;
    packet[0x04] = 0x24;
	packet[0x05] = 0x03; //packets 5 through 7 were based on debugging done by MoshiMoshi0 at https://moshimoshi0.github.io/ttrgbplusapi/controllers/riing-trio.html
	packet[0x06] = 0x01; //this needs to change to 0x02 to update leds, can cycle through 0x01>0x02>0x03>0x02>0x01 or 0x01>0x02>0x01 based on my manual updates
	packet[0x07] = 0x00;
	packet = packet.concat(data);
	device.write(packet, 128);
    device.read(packet,64)
}
function sendDirectPacket2(LEDcount, channel, data){

	var packet = [];
    packet[0x00] = 0x00;
    packet[0x01] = 0x32;
    packet[0x02] = 0x52;
    packet[0x03] = channel + 1;
    packet[0x04] = 0x24;
	packet[0x05] = 0x03;
	packet[0x06] = 0x02;
	packet[0x07] = 0x00;
	packet = packet.concat(data);
	device.write(packet, 128);
    device.read(packet,64)
}

var savedFanSpeed;
var LastFanCheck = Date.now();

function setFanRPM(){
    savedFanSpeed = FanSpeedPercent;
    for(var channel = 1;channel <= 5;channel++){
        var packet = [];
        packet[0] = 0x00;
        packet[1] = 0x32;
        packet[2] = 0x51;
        packet[3] = channel;
        packet[4] = 0x01;
        packet[5] = FanSpeedPercent
        device.write(packet, 120);
        device.read(packet,64);
    }
}
function readFanRPM(){
    var FanData = []
    for(var channel = 1;channel <= 5;channel++){
        var packet = [];
        packet[0] = 0x00;
        packet[1] = 0x33;
        packet[2] = 0x51;
        packet[3] = channel + 1;
        device.write(packet, 65);
        packet = device.read(packet,64);
        let RPM = (packet[7] << 8) + packet[6]
        //device.log(parseInt((packet[7] << 8) + packet[6],16))
        FanData.push(`Fan ${channel} ${RPM}`)
    }
    device.log(FanData)
}

export function Render()
{
    CheckComponentStatus();
    for(let channel = 0; channel < 5; channel++){
        Sendchannel(channel);
    }

    InitCustomStrip();
    SetFans();

    if(savedFanSpeed != FanSpeedPercent){
        setFanRPM();
    }
    // if(Date.now() - LastFanCheck > 5000){
    //     LastFanCheck = Date.now()
    //     readFanRPM();
    // }

}
var ComponentNotificationId;
function CheckComponentStatus(){
    if(ComponentNotificationId == true){
        return;
    }
    var propertyArray = [device1,device2,device3,device4,device5];
        for (var deviceNumber = 0; deviceNumber < propertyArray.length; deviceNumber++ ) {
            if(propertyArray[deviceNumber] != "None"){
                if(ComponentNotificationId != true){
                    device.denotify(ComponentNotificationId);
                    ComponentNotificationId = true;
                }
                return;
                }
        }

    if(typeof ComponentNotificationId === 'undefined'){
        ComponentNotificationId = device.notify("Device configuration needed", `You have not configured any connected components for this device. SignalRGB cannot control any connected fans or light strips until this is done.`, 0);
    }
}
